import React from 'react';

const EnrollmentDetails = ({ details }) => {
    return (
        <div>
            <h2>Enrollment Details</h2>
            <p>Name: {details.name}</p>
            <p>Age: {details.age}</p>
            <p>Selected Batch: {details.selectedBatch}</p>
            <p>Enrollment Date: {details.enrollmentDate}</p>
            <p>Payment Details: {details.paymentDetails}</p>
        </div>
    );
};

export default EnrollmentDetails;
